	// }, []);

	return (
		<>
			<Head>
				<meta name={'viewport'} content={'minimum-scale=1, initial-scale=1, width=device-width'} />
				<title>{'Development'}</title>
			</Head>
			<ThemeProvider theme={theme}>
				{/* eslint-disable-next-line react/jsx-props-no-spreading */}
				<Component {...pageProps} />
			</ThemeProvider>
		</>
	);
}
